@Override
public void init(NamedList args) {
  super.init(args);

  // Caching off by default
  httpCaching = false;
  if (args != null) {
    Object caching = initArgs.get("httpCaching");
    if(caching!=null) {
      httpCaching = Boolean.parseBoolean(caching.toString());
    }
  }
}

